e = ''

stringChangeASCIINumberArrs = function(e) {
  for (var t = [], n = 0; n < e.length; n++)
      t.push(e.charCodeAt(n));
  return t
}

pubPass = "BX1o65CoobwcDP33iQW6ld1OyIPsNzF1"
pubPassNum = []

setPass = function(e) {
  pubPassNum = stringChangeASCIINumberArrs(e)
}

setPass(pubPass)

decryptCode = function(e) {
  var t = ""
    , n = 0
    , i = ""
    , r = []
    , o = []
    , a = 0
    , s = 0;
  t = e.substr(4, 1),
  n = parseInt(t, 36),
  i = e.substr(5, n),
  r = stringChangeASCIINumberArrs(i),
  t = e.substr(5 + n, e.length - 5 - n);
  for (var l = "", c = 0, u = 0, h = 0; h < t.length / 2; h++)
      l = t.substr(u, 2),
      u += 2,
      c = parseInt(l, 36),
      s == r.length && (s = 0),
      c -= r[s],
      s++,
      a == pubPass.length && (a = 0),
      c -= pubPassNum[a],
      a++,
      l = String.fromCharCode(c),
      o.push(l);
  return t = o.join(""),
  t = decodeURI(t),
  t
}

decode = function(e) {
  var t;
  try {
      t = JSON.parse(decryptCode(e))
  } catch (n) {
      return void console.error(n + "json对象转出失败")
  }
  return t
}

function get(e) {
  a = decode(e)
  // console.log(a.results[0].args[0].list[0])
  return a.results[0].args[0].list[0]
}